const mongoose = require("mongoose");

const UserSchema = new mongoose.Schema(
	{
		first_name: {
			type: String,
			required: true,
			maxlength: 50,
		},
		last_name: {
			type: String,
			required: true,
			maxlength: 50,
		},
		username: {
			type: String,
			required: true,
			unique: true,
			maxlength: 50,
		},
		email: {
			type: String,
			required: true,
			unique: true,
			maxlength: 100,
		},
		password: {
			type: String,
			required: true,
		},
		is_active: {
			type: Boolean,
			default: true,
		},
		avatar: {
			type: String,
			default:
				"data:image/jpeg;base64,",
		},
		language: {
			type: String,
			enum: ["en", "vi"],
			default: "vi",
		},
		history_match: [
			{
				type: mongoose.Schema.Types.ObjectId,
				ref: "Match",
			},
		],
		bio: {
			type: String,
			default: null,
		},
		github_url: {type: String, default: null},
		linkedin_url: {type: String, default: null},
		website_url: {type: String, default: null},
		youtube_url: {type: String, default: null},
		facebook_url: {type: String, default: null},
		instagram_url: {type: String, default: null},
		isVerified: {
			type: Boolean,
			default: false,
		},
		verificationCode: {
			type: String,
		},
		verificationCodeExpires: {
			type: Date,
		},
		resetPasswordToken: {
			type: String,
		},
		resetPasswordExpires: {
			type: Date,
		},
		resetPin: {
			type: String,
		},
		resetPinExpires: {
			type: Date,
		},
		tempAuthHashCode: {
			type: String,
			default: null,
		},
		tempAuthHashCodeExpires: {
			type: Date,
			default: null,
		},
		changeEmailPin: {
			type: String,
		},
		changeEmailPinExpires: {
			type: Date,
		},
		changeMailAuthHashCode: {
			type: String,
		},
		changeMailAuthHashCodeExpires: {
			type: Date,
		},
		newEmail: {
			type: String,
		},
		newEmailPin: {
			type: String,
		},
		newEmailPinExpires: {
			type: Date,
		},
		refreshTokens: [
			{
				token: {
					type: String,
					required: true,
				},
				createdAt: {
					type: Date,
					default: Date.now,
				},
				expiresAt: {
					type: Date,
					required: true,
				},
				deviceInfo: {
					type: String,
					default: null,
				},
				ipAddress: {
					type: String,
					default: null,
				},
			},
		],
	},
	{
		createdAt: "created_at",
		updatedAt: "updated_at",
	}
);

exports.User = mongoose.model("User", UserSchema);
